import Reac, { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom';
import Delay from '../Delay/Delay';
import Home from '../Home/Home';
import "./Functions.scss"
export default function Functions() {
    const navigate = useNavigate()
    const [isLoading, setIsLoading] = useState(true);
    const [offcanvas, setOffcanvas] = useState(false)
    const [active, setActive ] = useState("")

    function closeOffcanvas() {
        sessionStorage.setItem("shop", false)
        navigate("/")
    }
    function bootstrapBnt() {
        let cur = sessionStorage.getItem("funcsion")
        setOffcanvas(true)
        if (cur !== "") {
            setOffcanvas(cur)
        }
    }
    function activeLink(iteam){
        setActive(iteam)
    }
    useEffect(() => {
        const redirectTimeout = setTimeout(() => {

            bootstrapBnt()
        }, 2000)
        return () => {
            clearTimeout(redirectTimeout);
        };
    }, [])
    useEffect(() => {
        setIsLoading(false)
        const delay = 1000;
        <Delay />
        const redirectTimeout = setTimeout(() => {
            setIsLoading(true)
        }, delay);

        return () => {
            clearTimeout(redirectTimeout);
        };
    }, [])
    return (

        <div>
            {!isLoading ? <Delay /> : <>
                <Home />
                <div className={`${offcanvas === "true" ? "active-filter" : ""} offcanvas-filter`} onClick={closeOffcanvas}>
                </div>
                <div className={`${offcanvas === "true" ? "active-offcanvas" : ""} offcanvass`}>
                    <div className='container funcsion'>
                        <h4>Functions</h4>
                        <div className='orders active-orders'>
                            <div onClick={()=> activeLink("div1")} className={`${active === "div1" ? "activeLink" : ""} orders-card`}>
                                <div>
                                    <div><i className="bi bi-info-circle me-3"></i> Information</div> 
                                </div>
                            </div>
                            <div onClick={()=> activeLink("div2")} className={`${active === "div2" ? "activeLink" : ""} orders-card`}>
                                <div >
                                    <div><i className="bi bi-translate me-3"></i> Information</div> 
                                </div>
                            </div>
                            <div onClick={()=> activeLink("div3")} className={`${active === "div3" ? "activeLink" : ""} orders-card`}>
                                <div  >
                                    <div><i class="bi bi-stopwatch me-3"></i>  Order History</div> 
                                </div>
                            </div>
                        </div>

                        <div>
                            <div>
                            +998 71 000 00 71
                            </div>
                            <div>
                            Tashkent, str. Amir Temur 15
                            </div>
                            <div>
                                <a href="">umdovech</a>
                            </div>
                            <div>
                                
                            </div>
                        </div>
                    </div>
                </div>
            </>}

        </div>
    )
}
